import MainPart from "./MainPart/main_part";
import PhotosPart from "./PhotosPart/photos_part";
import Bottom from "./Bottom/bottom";
import Footer from "./Footer/footer";
import Header from "./Header/header";
import React from "react";
import Trolleybuses from "../Catalog/Trolleybuses/trolleybuses";

function Home() {
        const trolleybusesItems = [
                { id: 1, img: <img src="/icons/big_trolleybus.png" alt="photo1" width="370" height="220"/>, title: 'TRHD-533', description:'hrrehre'},
                { id: 2, img: <img src="/icons/ordinary_trolleybus.png" alt="photo2" width="370" height="220" />, title: 'GYUJNE-222', description:'hetfd'},
        ];
        return (
            <div>
                <Header/>
                <MainPart/>
                <PhotosPart>
                    <div className="product-list">
                            {trolleybusesItems.map((trolleybuses) => (
                                <Trolleybuses key={trolleybuses.id} product={trolleybuses} />
                            ))}
                    </div>
                </PhotosPart>
                    <div className="product-list">
                            {trolleybusesItems.map((trolleybuses) => (
                                <Trolleybuses key={trolleybuses.id} product={trolleybuses} />
                            ))}
                    </div>
                <Bottom/>
                <Footer/>
            </div>
        )
}

export default Home;
